import React from 'react';
import './DetailsCard.css';

function DetailsCard(props) {
  return (
    <div className="DetailsCard">
      <h3>{props.data.StockName}</h3>
      <ul>
        <li><span>Quantity Holding:</span> {props.data.QuantityHolding}</li>
        <li><span>Purchased Price:</span> {props.data.PurchasedPrice}</li>
        <li><span>Sold Price:</span> {props.data.SoldPrice}</li>
        <li><span>Purchasing Date:</span> {props.data.PurchasingDate}</li>
        <li><span>Selling Date:</span> {props.data.SellingDate}</li>
      </ul>
    </div>
  );
}

export default DetailsCard;
